  input: '"TEXT","F3XA","C00005173","The Democratic State Party Victory Fund is an
    ongoing direct mail Joint fundraising program between the DNC and the State Democratic
    Executive Committee of Alabama.  Accordingly the DNC provides memo schedules on
    a semi-annual basis and not with each proceed transfer. The memo entries in this
    report reflect activity for the last six months of 2003. The actual proceed transfer
    from the Victory Fund is not limited to the dates of this reporting period. Likewise,
    Dollars for Democrats is also an ongoing fundraising program and the memo entries
    reflect activity that is reported to the FEC during this reporting period. The
    actual proceed transfer from Dollars for Democrats is not limited to the dates
    of this reporting period. There was no FEA during this reporting period. All transfers
    from the non-federal account for allocated activities are timely made within the
    70-day period, no more than 10 days before or 6 days after vendor payment. Schedule
    H-4 is amended to clarify that the computer maintenance payment was to a vendor.
    All administrative expenses (excluding salary) were paid from the federal account;
    there were no in-kind contributions."'
